import styled from "styled-components";

export const NavContainer = styled.nav`
  display: flex;
  flex: 0 1 ${NAV_WIDTH};
  flex-direction: column;
  align-items: center;
`;

export const ClubInformation = styled.div`
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  height: 240px;
`;
